import React from "react";
import Navigation from "../../components/Navigation";

const TemplatePage = (props) => {
    return(
        <>
        <Navigation />
            <div className='flex border h-screen mx-3'>
                <p className="border w-full flex justify-center mt-10">{props.sectionName}</p>
            </div>
        </>
    );
}

export default TemplatePage;
